import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';

const Home = () => {
  return (
    <div>
      

      {/* Main Content */}
      <div className="container my-5">
        <div className="text-center my-5">
          <h1>Welcome to CryptoBank</h1>
          <p>Your trusted partner for managing your finances.</p>
        </div>
        
        {/* About Us Section */}
        <section id="about" className="about-us py-5">
          <h2>About Us</h2>
          <p>
            Welcome to our CryptoBank. We aim to provide efficient and reliable banking services to our customers, ensuring seamless transactions and secure account management. Our system allows users to view balances, make transactions, and track their financial activities with ease.
          </p>
        </section>

        {/* Contact Us Section */}
        <section id="contact" className="contact-us py-5">
          <h2>Contact Us</h2>
          <p>If you have any questions or feedback, feel free to reach out to us.</p>
          <p>+91-978751641</p>
        </section>
      </div>

      {/* Inline CSS */}
      <style jsx>{`
        .navbar {
          margin-bottom: 40px;
        }

        .about-us, .contact-us {
          padding: 40px;
          text-align: center;
          background-color: #ffffff;
          margin-top: 20px;
          border-radius: 8px;
          box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
        }

        .about-us h2, .contact-us h2 {
          color: #007bff;
        }

        .about-us p, .contact-us p {
          color: #495057;
          font-size: 16px;
          line-height: 1.5;
        }

        .contact-us form input,
        .contact-us form textarea {
          width: 80%;
          padding: 10px;
          margin: 10px 0;
          border: 1px solid #ccc;
          border-radius: 4px;
        }

        .contact-us form button {
          padding: 10px 20px;
          background-color: #007bff;
          color: white;
          border: none;
          border-radius: 4px;
          cursor: pointer;
        }

        .contact-us form button:hover {
          background-color: #0056b3;
        }
      `}</style>
    </div>
  );
};

export default Home;
